pragma solidity 0.4.18;

import "./Tranche.sol";
//import "../test/dummy_tokens/DummyToken.sol";
import "NonFungibleToken/contracts/NonFungibleToken.sol";
import "zeppelin-solidity/contracts/math/SafeMath.sol";
import "zeppelin-solidity/contracts/ownership/Ownable.sol";
import "zeppelin-solidity/contracts/token/ERC20/ERC20.sol";
//import "zeppelin-solidity/contracts/token/ERC20/MintableToken.sol";


contract CDO is Ownable{
    using SafeMath for uint;

    ERC20 public valueToken;

    Tranche public senior;
    Tranche public mezzanine;

    event TestEvent(uint flag, uint data);
    event TestEventAddr(uint flag, address addr);

    function CDO (
        address _tokenContract,
        address _seniorTranche,
        address _mezzanineTranche
    )
        public
    {
        valueToken = ERC20(_tokenContract);

        //IMPORTANT: Transfer tranche ownership to the address of this contract!!
        //https://github.com/OpenZeppelin/zeppelin-solidity/blob/master/contracts/ownership/Ownable.sol
        senior = Tranche(_seniorTranche);
        mezzanine = Tranche(_mezzanineTranche);
    }

    function getSeniorTokenOwner(uint _tokenId) public view returns(address)
    {
        address tokenOwner = senior.ownerOf(_tokenId);
        return tokenOwner;
    }

    function getMezzanineTokenOwner(uint _tokenId) public view returns(address)
    {
        address tokenOwner = mezzanine.ownerOf(_tokenId);
        return tokenOwner;
    }

    function getPayoutBalance(address _payer) public view returns(uint) {
        return valueToken.balanceOf(_payer);
    }


    function payout() public {
        uint addedPayout = 0;
        if(
            senior.totalPayout() < senior.expectedPayoutTotal() && 
            senior.totalSupply() == senior.trancheLimit()
        )
        {
            addedPayout = addedPayout.add(_payout(senior));
        }
        if(
            senior.totalPayout() == senior.expectedPayoutTotal() && 
            mezzanine.totalPayout() < mezzanine.expectedPayoutTotal() && 
            senior.totalSupply() == senior.trancheLimit() &&
            mezzanine.totalSupply() == mezzanine.trancheLimit()
        )
        {
            addedPayout = addedPayout.add(_payout(mezzanine));
        }

        //THIS LINE CAUSES THE PROBLEM
        valueToken.transfer(msg.sender, addedPayout);
    }

    function _payout(Tranche tranche) internal returns(uint){
        uint i; //for me to loop on
        uint amountPaid = tranche.totalPayout();

        uint tokensAvailable = valueToken.balanceOf(address(this));

        //following code is not safe for division, using if-statement instead
        //uint payoutAvailable = (tranche.expectedPayoutTotal() < amountPaid + tokensAvailable) ? tranche.expectedPayoutTotal() : tokensAvailable;
        //uint payoutAvailablePerToken = payoutAvailable.div(tranche.trancheLimit());
        uint payoutAvailablePerTrancheToken;
        //this is much safer because it will guarantee a full payment on a fractional edge-case...
        // ... so long as the balance can support the full amount.
        if(tranche.expectedPayoutTotal() < amountPaid + tokensAvailable) {
            payoutAvailablePerTrancheToken = tranche.trancheValue();
        } else {
            //remember, division rounds down, but we dont have to worry about that
            payoutAvailablePerTrancheToken = tokensAvailable.add(amountPaid).div(tranche.trancheLimit());
        }

        uint addedPayout = 0;

        //NOPE! I can't do this... /bonk ... dynamic types cannot be passed around.
        //uint[] ownerTokens = tranche.getOwnerTokens(msg.sender);
        //Do this instead...
        uint ownerBalance = tranche.balanceOf(msg.sender);

        for (i = 0; i < ownerBalance; i++) {
            uint _tokenId = tranche.tokenOfOwnerByIndex(msg.sender, i);
            uint addedValue = tranche.matchPayout(_tokenId, payoutAvailablePerTrancheToken);
            addedPayout = addedPayout.add(addedValue);
        } 
        return addedPayout;
    }

    function transfer(address _to, uint _amount) public onlyOwner {
        valueToken.transfer(_to, _amount);
    }

}
